    def AddObjects(self):

        self.AddObject("game", "map", self.map)

        self.AddObject("game", "player", self.player)

        self.AddObject("game", "buy panel", Object((50, 50), (self.width - 100, self.height - 100), show=False))
        self["game"]["buy panel"].AddSurface("Normal", pygame.Surface((self.width - 100, self.height - 100)))
        self["game"]["buy panel"]["Normal"].set_alpha(200)
        self["game"]["buy panel"]["Normal"].fill(Gray)

        
