    def Draw(self) -> None:

        
        self.player.MoveMap(self.map)
        self.Debug(self.player.velocity)

        return super().Draw()

    def HandleEvents(self, event: pygame.event.Event) -> None:
        
        super().HandleEvents(event)
    
        if event.type == pygame.KEYUP:

            if event.key == pygame.K_b:
                
                self["game"]["buy panel"].show = not self["game"]["buy panel"].show

    def Run(self) -> None:

        self.OpenTab("game")
        self.MakeFullScreen()

        super().Run()


